import React from 'react';
import {Card, Col, Image} from "react-bootstrap";

const PhotoItem = ({photo}) => {
    console.log(photo);
    return (
        <Col md={4} >

                <Image style={{width: "100%", marginTop: "15px" }} src={process.env.REACT_APP_API_URL + photo.img}/>

        </Col>
    );
};

export default PhotoItem;
